const express = require('express');
const fs = require('fs');
const historyApiFallback = require('connect-history-api-fallback');
const mongoose = require('mongoose');
const path = require('path');
const webpack = require('webpack');
const webpackDevMiddleware = require('webpack-dev-middleware');
const webpackHotMiddleware = require('webpack-hot-middleware');
const session = require('express-session');
const bodyParser = require('body-parser');
const passport = require('passport')

const config = require('../config/config');
const passportConfig = require('../config/passport');
const webpackConfig = require('../webpack.config');

const comments = require('./routes/api/comments');
const profile = require('./routes/api/profile');
const posts = require('./routes/api/posts');
const signin = require('./routes/api/signin');
// const dashboard = require('./routes/api/dashboard');


const isDev = process.env.NODE_ENV !== 'production';
const port  = process.env.PORT || 8080;

const socketEvents = require('./socketEvents');

// Configuration
// ================================================================================================

// Set up Mongoose
mongoose.connect(isDev ? config.db_dev : config.db);
mongoose.Promise = global.Promise;


const io = require('socket.io').listen(8081);
socketEvents(io);

const app = express();
app.use(express.urlencoded({ extended: true }));
app.use(bodyParser.urlencoded({extended: true}));
app.use(bodyParser.json());
app.use(express.json());
// app.use(function (req, res, next) {
// res.header("Access-Control-Allow-Methods", "POST, PUT, OPTIONS, DELETE, GET");
// res.header('Access-Control-Allow-Origin', '*');
// res.header("Access-Control-Allow-Headers", "Origin, X-Requested-With, Content-Type, Accept");
// res.header("Access-Control-Allow-Credentials", true);
// next();
// });

//set up passport
app.use(passport.initialize())
app.use(passport.session());
require('../config/passport')(passport);

app.use('/api/comments', comments);
app.use('/api/profile', profile);
app.use('/api/posts', posts);
app.use('/api/account', signin);
// app.use('/api', dashboard);


// API routes
// require('./routes')(app);

if (isDev) {
  const compiler = webpack(webpackConfig);

  app.use(historyApiFallback({
    verbose: false
  }));

  app.use(webpackDevMiddleware(compiler, {
    publicPath: webpackConfig.output.publicPath,
    contentBase: path.resolve(__dirname, '/client/index.html'),
    stats: {
      colors: true,
      hash: false,
      timings: true,
      chunks: false,
      chunkModules: false,
      modules: false
    }
  }));

  app.use(webpackHotMiddleware(compiler));
  app.use(express.static(path.resolve(__dirname, 'dist')));
} else {
  app.use(express.static(path.resolve(__dirname, 'dist')));
  app.get('*', function (req, res) {
    res.sendFile(path.join(__dirname, '/dist/index.html'));
    res.end();
  });
}

app.listen(port, '0.0.0.0', (err) => {
  if (err) {
    console.log("This is the error from listening on port...." + err);
  }

  console.info('>>> ðŸŒŽ Open http://0.0.0.0:%s/ in your browser.', port);
});

module.exports = app;

